import React from "react";
import { Link } from "react-router-dom";

const links = [
    {
        name: "Nosotros",
        href: "/nosotros",
    },
    {
        name: "Promociones",
        href: "/promociones",
    },
    {
        name: "Fotos",
        href: "/fotos",
    },
    {
        name: "Ir a la tienda",
        href: "/tienda",
    },
    {
        name: "Inicio",
        href: "/inicio",
    }

]

const NavBar = () => {
    return <div>
        {links.map(x => (
            <Link to={x.href}>{x.name}</Link>))
        }
    </div>;
};

export default NavBar;
